import React from 'react';
import './Header.css';
import logo from './logo.svg';

export default function Header({ onMindBotClick, darkMode, setDarkMode }) {
  return (
    <header className="mindcare-header">
      <div className="header-left">
        <a href="/" style={{display:'flex', alignItems:'center', textDecoration:'none'}}>
          <img src={logo} alt="MindCare Logo" className="header-logo" />
          <span className="header-title">MindCare</span>
        </a>
      </div>
      <nav className="header-nav" style={{flex: 1, justifyContent: 'center', display: 'flex'}}>
        <a href="/" className="header-link">Home</a>
        <a href="#mental" className="header-link">Mental Stuff</a>
        <a href="#tools" className="header-link">Cool Tools</a>
        <a href="#why-we-care" className="header-link">Why We Care</a>
        <a href="#login" className="header-link">Log In</a>
        <button
          style={{
            marginLeft: 16,
            padding: '6px 16px',
            borderRadius: 20,
            border: 'none',
            background: darkMode ? '#232526' : '#eaf3fb',
            color: darkMode ? '#fff' : '#2d3a4a',
            boxShadow: '0 2px 8px #b3d8f7',
            cursor: 'pointer',
            fontWeight: 600,
            fontSize: '1rem',
            alignSelf: 'center'
          }}
          aria-label={darkMode ? 'Switch to light mode' : 'Switch to dark mode'}
          onClick={() => setDarkMode(m => !m)}
        >
          {darkMode ? 'üåô Dark Mode' : '‚òÄÔ∏è Light Mode'}
        </button>
      </nav>
      <div style={{display:'flex', alignItems:'center', justifyContent:'flex-end', minWidth: 160}}>
        <button className="mindbot-btn" onClick={onMindBotClick}>
          Let's Talk
        </button>
      </div>
    </header>
  );
}
